style.css:
@-moz-document url-prefix("https://www.character.ai/") {
/* Apply background image to body and html */
    body, html {
        background: url('https://imgur.com/6ijbjD8') fixed no-repeat center center / cover !important;
        min-height: 100vh !important;
        color: #e0e0e0 !important; /* Light grey text color for readability */
    }

    /* General text and headings */
    p, h1, h2, h3, h4, h5, h6, .text, .label {
        color: #e0e0e0 !important; /* Light grey text */
    }

    /* Links */
    a {
        color: #a3a3ff !important; /* Soft blue */
    }

    a:visited {
        color: #8585d6 !important; /* Darker soft blue */
    }

    /* Main containers */
    .container, .main-content, .header, .footer, .container-lg, .content {
        background-color: rgba(0, 0, 0, 0.6) !important; /* Semi-transparent dark background */
        color: #e0e0e0 !important; /* Light grey text */
    }

    /* Buttons */
    .btn-primary, .btn-secondary, .btn-action {
        background-color: #4c4c8f !important; /* Soft dark blue */
        color: #e0e0e0 !important; /* Light grey text */
        border-color: #4c4c8f !important; /* Soft dark blue */
    }

    .btn-secondary, .btn-neutral {
        background-color: #6a6aad !important; /* Softer blue */
        color: #e0e0e0 !important; /* Light grey text */
        border-color: #6a6aad !important; /* Softer blue */
    }

    /* Input fields and text areas */
    input, textarea {
        background-color: rgba(255, 255, 255, 0.2) !important; /* Semi-transparent white */
        color: #e0e0e0 !important; /* Light grey text */
        border-color: #4c4c8f !important; /* Soft dark blue */
    }

    /* Sidebar */
    .sidebar, .sidebar-container {
        background-color: rgba(0, 0, 0, 0.7) !important; /* Semi-transparent dark background */
        color: #e0e0e0 !important; /* Light grey text */
    }

    /* Darken dropdown menus */
    .dropdown-menu {
        background-color: rgba(0, 0, 0, 0.8) !important; /* Darker semi-transparent black */
        color: #e0e0e0 !important; /* Light grey text */
    }

    /* Navbar */
    .navbar, .nav-menu {
        background-color: rgba(0, 0, 0, 0.6) !important; /* Semi-transparent dark background */
        color: #e0e0e0 !important; /* Light grey text */
    }

    /* Ensure other containers don't override the background */
    .content, .page-container, .page-content {
        background: transparent !important;
    }
}
